script: |
  super -f tsv -I q8675.sql | sort > q8675.out

vector: true

inputs:
  - name: q8675.sql
    data: |
      SELECT ALL - 62 / + 37 AS col2, + col2 AS col2 FROM tab0 WHERE - col1 NOT BETWEEN 6 AND ( 91 * - 52 + - col0 * + ( + col2 ) );
  - name: tab0

outputs:
  - name: q8675.out
    data: |
      -1	10
      -1	47
      -1	99
